import React from "react"
import Flight from '../../Parts/Header/Search/flight/flight.js'
import Car from '../../Parts/Header/Search/car/car.js'
import Hotel from '../../Parts/Header/Search/hotel/hotel.js'

class TabItemContent extends React.Component{
  render() {
    return (
      <div id={this.props.id} className={this.props.className}>
        {this.props.content}
      </div>
    )
  }
}
export default TabItemContent
